## Question 1
In the figure, five congruent right triangles are arranged to form quadrilateral $PQRS$.  Points $U$ and $V$ are midpoints of $PR$ and $QS$, respectively.  When $U$ and $V$ are joined, the quadrilateral is divided into two smaller quadrilaterals.  The ratio of the area of quadrilateral $PUVQ$ to the area of quadrilateral $UVRS$ in simplified form is $m:n$. Find $m+n$.

[asy]
pair P, Q, R, S, T, U, V;
P= (0, 15);
Q=(24, 15);
R=(24, 0);
S=(0, 0);
T=(12, 0);
U=(P+R)/2;
V=(Q+S)/2;
draw(U--V, dashed);
draw(P--Q--R--S--P);
draw(P--T--R);
draw(T--S, dashed);
label("P", P, NW);
label("Q", Q, NE);
label("R", R, SE);
label("S", S, SW);
label("T", T, S);
label("U", U, E);
label("V", V, W);
[/asy]

## Answer 1
## Step 1:  To find the ratio of the area of quadrilateral $PUVQ$ to the area of quadrilateral $UVRS$, we need to analyze the given figure and understand its properties.
## Step 2:  We observe that five congruent right triangles are arranged to form quadrilateral $PQRS$, and points $U$ and $V$ are midpoints of $PR$ and $QS$, respectively.
## Step 3:  The given figure suggests that $PQ=RS$ and $QR=PS$, implying that $PQRS$ is a parallelogram. Since opposite sides of a parallelogram are equal, we can conclude that $PQRS$ is a parallelogram.
## Step 4:  We also notice that $\triangle PUV$ and $\triangle QRV$ are congruent due to the properties of the midpoints of the sides of a parallelogram. Similarly, $\triangle VUS$ and $\triangle QUT$ are congruent.
## Step 5:  Additionally, we can prove that $\triangle PUV$ is congruent to $\triangle QRV$ and $\triangle VUS$ is congruent to $\triangle QUT$ by the SAS Congruence Theorem.
## Step 6:  Now, to find the ratio of the areas, we need to consider the areas of these triangles. The area of a triangle is given by the formula $\frac{1}{2} \times \text{base} \times \text{height}$.
## Step 7:  By comparing the areas of the triangles, we can conclude that the area of quadrilateral $PUVQ$ is equal to the area of quadrilateral $UVRS$ plus the area of $\triangle QUT$.
## Step 8:  Since the area of quadrilateral $UVRS$ is equal to the area of $\triangle QRV$ plus the area of $\triangle VUS$, and the area of quadrilateral $PUVQ$ is equal to the area of quadrilateral $UVRS$ plus the area of $\triangle QUT$, we can express the ratio of the areas as $\frac{2\triangle QRV + \triangle QUT}{2\triangle QRV}$.
## Step 9:  Further simplifying this expression, we get $\frac{2+1}{2}=\frac{3}{2}$, which represents the ratio of the areas of quadrilateral $PUVQ$ to quadrilateral $UVRS$.
## Step 10:  Therefore, the sum of the ratio is $3+2=5$.

The final answer is: $\boxed{5}$
5

